import{_ as l,c as a,o as i,a4 as e}from"./chunks/framework.qL1yNBZ5.js";const q=JSON.parse('{"title":"通大美食大盘点","description":"","frontmatter":{},"headers":[],"relativePath":"life/food.md","filePath":"life/food.md"}'),t={name:"life/food.md"},o=e('<h1 id="通大美食大盘点" tabindex="-1">通大美食大盘点 <a class="header-anchor" href="#通大美食大盘点" aria-label="Permalink to &quot;通大美食大盘点&quot;">​</a></h1><blockquote><p>所有信息来源于投稿和网络，如有侵权，请联系我们！</p></blockquote><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>小吃怡情，大吃伤身，强吃灰飞烟灭。适量合理品鉴美食！（虽然没有多少美食）</p></div><h2 id="一食堂" tabindex="-1">一食堂 <a class="header-anchor" href="#一食堂" aria-label="Permalink to &quot;一食堂&quot;">​</a></h2><h3 id="_1楼" tabindex="-1">1楼 <a class="header-anchor" href="#_1楼" aria-label="Permalink to &quot;1楼&quot;">​</a></h3><ul><li>中间的卤肉饭</li><li>中间靠左的面档口 首推牛肉土豆粉</li><li>最右侧干锅鸡块好吃</li><li>中间靠右烫饭还可以</li></ul><h3 id="_2楼" tabindex="-1">2楼 <a class="header-anchor" href="#_2楼" aria-label="Permalink to &quot;2楼&quot;">​</a></h3><ul><li>左边水煮肉片</li><li>炸货铺的淀粉肠</li><li>中间的味孔记面条 石锅拌饭</li><li>咖喱鸡排饭配可乐绝了</li></ul><hr><h2 id="二食堂" tabindex="-1">二食堂 <a class="header-anchor" href="#二食堂" aria-label="Permalink to &quot;二食堂&quot;">​</a></h2><h3 id="_1楼-1" tabindex="-1">1楼 <a class="header-anchor" href="#_1楼-1" aria-label="Permalink to &quot;1楼&quot;">​</a></h3><ul><li>左侧面的店 拌面好吃</li><li>基本大伙还可以</li><li>豆浆特别好喝，就是机子打的那种醇厚的（红枣、绿豆、原味加糖强推这三个！）</li><li>右侧妈妈炒饭!好吃</li><li>麻辣香锅</li><li>水煮肉片（一定要加土豆粉！！！）</li><li>早上限定太阳饼（不知道啥时候就卖光了也不知道啥时候又做好了）</li><li>可乐鸡</li></ul><h3 id="_2楼-好吃的最多" tabindex="-1">2楼(好吃的最多) <a class="header-anchor" href="#_2楼-好吃的最多" aria-label="Permalink to &quot;2楼(好吃的最多)&quot;">​</a></h3><ul><li>老广味道(猪脚饭/叉烧饭!)特别好吃</li><li>兄弟拉面!</li><li>兰州拉面!</li><li>基本大火!</li><li>清真食堂!</li><li>黄焖小磨豆腐，便宜又好吃</li><li>奔跑鸡！！！</li></ul><hr><h2 id="三食堂" tabindex="-1">三食堂 <a class="header-anchor" href="#三食堂" aria-label="Permalink to &quot;三食堂&quot;">​</a></h2><h3 id="_1楼-2" tabindex="-1">1楼 <a class="header-anchor" href="#_1楼-2" aria-label="Permalink to &quot;1楼&quot;">​</a></h3><ul><li>早上能去吃个肠粉(只有三食堂有)</li></ul><h3 id="_2楼-1" tabindex="-1">2楼 <a class="header-anchor" href="#_2楼-1" aria-label="Permalink to &quot;2楼&quot;">​</a></h3><ul><li>麻辣烫最好吃</li><li>馋嘴小酥肉！！！！！！！</li></ul><hr><h2 id="校外" tabindex="-1">校外 <a class="header-anchor" href="#校外" aria-label="Permalink to &quot;校外&quot;">​</a></h2><h3 id="大有境" tabindex="-1">大有境 <a class="header-anchor" href="#大有境" aria-label="Permalink to &quot;大有境&quot;">​</a></h3><ul><li>白石（日料，好吃不踩雷，去晚要排队）</li><li>泰妃殿（还行 小贵 要排队 可以拍照）</li><li>蛙喔</li><li>胖哥俩</li><li>太二酸菜鱼（连锁的都）</li><li>一绪寿喜烧（自助 吃肉）</li><li>左庭右院（潮汕牛肉火锅）</li><li>鳗满（主打鳗鱼饭 1-2人可去）</li><li>绿茶餐厅（正常水准）</li><li>海底捞（在B座）</li><li>豆库（在彩虹漾 西式简餐）</li></ul><h3 id="啬园西门出去" tabindex="-1">啬园西门出去 <a class="header-anchor" href="#啬园西门出去" aria-label="Permalink to &quot;啬园西门出去&quot;">​</a></h3><ul><li>铁锅炖(多人好评 没吃过)</li></ul><h3 id="青创园" tabindex="-1">青创园 <a class="header-anchor" href="#青创园" aria-label="Permalink to &quot;青创园&quot;">​</a></h3><ul><li>辣三碗（嘎嘎好吃 辣的 炒饭好吃）</li><li>五毛炸串（老店!小海中学对面）</li><li>早海鱼市（人多可以吃，相当于家常）</li></ul><h3 id="南大街" tabindex="-1">南大街 <a class="header-anchor" href="#南大街" aria-label="Permalink to &quot;南大街&quot;">​</a></h3><ul><li>兰雀茶餐厅（港式茶餐厅）</li></ul><h3 id="宿舍团建必备" tabindex="-1">宿舍团建必备! <a class="header-anchor" href="#宿舍团建必备" aria-label="Permalink to &quot;宿舍团建必备!&quot;">​</a></h3><ul><li>小辣椒泡菜坊 人均 40-50 干三碗米饭</li><li>青创园二楼右手第一家炒菜 也不错</li></ul>',32),r=[o];function h(d,n,u,c,s,_){return i(),a("div",null,r)}const f=l(t,[["render",h]]);export{q as __pageData,f as default};
